INSERT INTO `tbl_pengumuman` (`pengumuman_id`, `pengumuman_judul`, `pengumuman_deskripsi`, `pengumuman_tanggal`, `pengumuman_author`) VALUES
(8, 'Pengumuman Pembagian Raport Semester Ganjil Tahun Ajaran 2022-2023', 'Menjelang berakhirnya proses belajar-mengajar di semester ganjil tahun ajaran 2022-2023, maka akan diadakan pembagian hasil belajar/raport pada tanggal 16 Desember 2022 pukul 07.30 WIB. Yang bertempat di GEDUNG A SMA S AL KAUTSAR. Raport diambil oleh orang tua/wali kelas murid masing-masing', '2022-12-20 07:59:47', 'Lukman'),
(9, 'Pengumuman Peresmian dan Launching Website Perdana SMA S AL KAUTSAR BANDAR LAMPUNG', 'Peresmian dan launching website resmi SMA S AL KAUTSAR akan diadakan pada Senin 19 Desember 2022', '2022-12-20 08:00:21', 'Lukman'),
(10, 'Pengumuman Proses Belajar Mengajar di Semester Genap Tahun Ajaran 2022-2023', 'Setelah libur semester ganjil tahun ajaran 2022-2023, proses belajar mengajar di semester genap tahun ajaran 2022-2023 mulai aktif kembali tanggal 2 Januari 2023', '2022-12-20 08:02:14', 'Lukman');
